import React from 'react';

const SingleGun = (props) => {
    console.log(props);
    const {gun} = props;
    const {action, bullet, img, name, category, price}= gun;
    return (
        <div>
            <div className="card w-full bg-base-100 shadow-xl my-4">
                <figure><img className='h-80 p-4' src={img} alt="Shoes" /></figure>
                <div className="card-body">
                    <h2 className="card-title">
                    {name}
                    <div className="badge badge-secondary">NEW</div>
                    </h2>
                    <p>If a dog chews shoes whose shoes does he choose?</p>
                    <div className="card-actions justify-end">
                    <div className="badge badge-outline">{action}</div> 
                    <div className="badge badge-outline">{bullet}</div>
                    <div className='flex justify-between w-full'>
                    <button className="btn btn-outline btn-secondary">Button</button>
                    <button className="btn btn-outline bt">Button</button>
                    </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default SingleGun;
